import React from 'react';
import './messenger.css';

function Messenger(){

  const SiderMessenger = () => {
      return(
        <div className="sider-messenger-container">
          <div className="sider-messenger-head">
            <div className="sider-messenger-title">
            </div>
            <div className="sider-messenger-search">
            </div>
          </div>
          <div className="sider-messenger-list-user">
          </div>
        </div>
      )
  }

  return(
      <div className="messenger-container">
        <SiderMessenger />
      </div>
  )
}

export default Messenger;
